import{_ as a,c as t,o as r,m as e,a as o}from"./chunks/framework.D5hbrQnr.js";const b=JSON.parse('{"title":"第一节　不动产登记","description":"","frontmatter":{},"headers":[],"relativePath":"repo/law-library/001 民法典/02 第二编：物权/01 第一分编：通则/02 第二章：物权的设立、变更、转让和消灭/01 第一节：不动产登记.md","filePath":"repo/law-library/001 民法典/02 第二编：物权/01 第一分编：通则/02 第二章：物权的设立、变更、转让和消灭/01 第一节：不动产登记.md"}'),_={name:"repo/law-library/001 民法典/02 第二编：物权/01 第一分编：通则/02 第二章：物权的设立、变更、转让和消灭/01 第一节：不动产登记.md"},s=e("h1",{id:"第一节-不动产登记",tabindex:"-1"},[o("第一节　不动产登记 "),e("a",{class:"header-anchor",href:"#第一节-不动产登记","aria-label":'Permalink to "第一节　不动产登记"'},"​")],-1),n=e("p",null,"第二百零九条　不动产物权的设立、变更、转让和消灭，经依法登记，发生效力；未经登记，不发生效力，但是法律另有规定的除外。 依法属于国家所有的自然资源，所有权可以不登记。 第二百一十条　不动产登记，由不动产所在地的登记机构办理。 国家对不动产实行统一登记制度。统一登记的范围、登记机构和登记办法，由法律、行政法规规定。 第二百一十一条　当事人申请登记，应当根据不同登记事项提供权属证明和不动产界址、面积等必要材料。 第二百一十二条　登记机构应当履行下列职责： （一）查验申请人提供的权属证明和其他必要材料； （二）就有关登记事项询问申请人； （三）如实、及时登记有关事项； （四）法律、行政法规规定的其他职责。 申请登记的不动产的有关情况需要进一步证明的，登记机构可以要求申请人补充材料，必要时可以实地查看。 第二百一十三条　登记机构不得有下列行为： （一）要求对不动产进行评估； （二）以年检等名义进行重复登记； （三）超出登记职责范围的其他行为。 第二百一十四条　不动产物权的设立、变更、转让和消灭，依照法律规定应当登记的，自记载于不动产登记簿时发生效力。 第二百一十五条　当事人之间订立有关设立、变更、转让和消灭不动产物权的合同，除法律另有规定或者当事人另有约定外，自合同成立时生效；未办理物权登记的，不影响合同效力。 第二百一十六条　不动产登记簿是物权归属和内容的根据。 不动产登记簿由登记机构管理。 第二百一十七条　不动产权属证书是权利人享有该不动产物权的证明。不动产权属证书记载的事项，应当与不动产登记簿一致；记载不一致的，除有证据证明不动产登记簿确有错误外，以不动产登记簿为准。 第二百一十八条　权利人、利害关系人可以申请查询、复制不动产登记资料，登记机构应当提供。 第二百一十九条　利害关系人不得公开、非法使用权利人的不动产登记资料。 第二百二十条　权利人、利害关系人认为不动产登记簿记载的事项错误的，可以申请更正登记。不动产登记簿记载的权利人书面同意更正或者有证据证明登记确有错误的，登记机构应当予以更正。 不动产登记簿记载的权利人不同意更正的，利害关系人可以申请异议登记。登记机构予以异议登记，申请人自异议登记之日起十五日内不提起诉讼的，异议登记失效。异议登记不当，造成权利人损害的，权利人可以向申请人请求损害赔偿。 第二百二十一条　当事人签订买卖房屋的协议或者签订其他不动产物权的协议，为保障将来实现物权，按照约定可以向登记机构申请预告登记。预告登记后，未经预告登记的权利人同意，处分该不动产的，不发生物权效力。 预告登记后，债权消灭或者自能够进行不动产登记之日起九十日内未申请登记的，预告登记失效。 第二百二十二条　当事人提供虚假材料申请登记，造成他人损害的，应当承担赔偿责任。 因登记错误，造成他人损害的，登记机构应当承担赔偿责任。登记机构赔偿后，可以向造成登记错误的人追偿。 第二百二十三条　不动产登记费按件收取，不得按照不动产的面积、体积或者价款的比例收取。",-1),c=[s,n];function l(i,d,p,h,m,f){return r(),t("div",null,c)}const x=a(_,[["render",l]]);export{b as __pageData,x as default};
